/*
We have a list of bus routes. Each routes[i] is a bus route that the i-th bus repeats forever. For example if routes[0] = [1, 5, 7], this means that the first bus (0-th indexed) travels in the sequence 1->5->7->1->5->7->1->... forever.

We start at bus stop S (initially not on a bus), and we want to go to bus stop T. Travelling by buses only, what is the least number of buses we must take to reach our destination? Return -1 if it is not possible.

Example:
Input: 
routes = [[1, 2, 7], [3, 6, 7]]
S = 1
T = 6
Output: 2
Explanation: 
The best strategy is take the first bus to the bus stop 7, then take the second bus to the bus stop 6.
 

Constraints:

1 <= routes.length <= 500.
1 <= routes[i].length <= 10^5.
0 <= routes[i][j] < 10 ^ 6.
*/

var numBusesToDestination = function (routes, S, T) {
  if (S === T) return 0;
  const busesTo = buildAdjList(routes);
  if (!busesTo[S] || !busesTo[T]) return -1;
  const visited = new Array(routes.length).fill(false);

  const queue = [S];

  let numBuses = 1;
  while (queue.length) {
    for (let end = queue.length - 1; end >= 0; end -= 1) {
      const stop = queue.shift();

      for (let bus of busesTo[stop]) {
        if (visited[bus]) continue;
        visited[bus] = true;
        for (let nextStop of routes[bus]) {
          if (nextStop === T) return numBuses;
          if (!busesTo[nextStop].length) continue;
          queue.push(nextStop);
        }
        busesTo[stop] = [];
      }
    }

    numBuses += 1;
  }

  return -1;
};

const buildAdjList = (routes) => {
  const adjList = {};

  for (let bus = 0; bus < routes.length; bus += 1) {
    for (let stop of routes[bus]) {
      adjList[stop] = adjList[stop] || [];
      adjList[stop].push(bus);
    }
  }

  return adjList;
}


